func TestLTTB(t *testing.T) {
	ctx := context.New()
	defer ctx.Close()

	seriesStart := time.Now()
	stepSize := 1000
	values := NewValues(ctx, stepSize, 10)
	for i := 0; i < values.Len(); i++ {
		values.SetValueAt(i, float64(i+1))
	}
	series := NewSeries(ctx, "foo", seriesStart, values)

	tests := []struct {
		startOffset     time.Duration
		endOffset       time.Duration
		threshold       int
		newStep         int
		resultThreshold int
	}{
		{
			startOffset: 0,
			endOffset:   0,
			threshold:   3,
			newStep:     stepSize * 4,
		},
		{
			startOffset: 0,
			endOffset:   0,
			newStep:     stepSize * 3,
			threshold:   4,
		},
		{
			startOffset: 0,
			endOffset:   0,
			newStep:     stepSize * 2,
			threshold:   5,
		},
		{
			startOffset:     0,
			endOffset:       0,
			newStep:         stepSize * 2,
			threshold:       6,
			resultThreshold: 5,
		},
		{
			startOffset:     0,
			endOffset:       0,
			newStep:         stepSize * 2,
			threshold:       7,
			resultThreshold: 5,
		},
	}

	for _, test := range tests {
		start := series.StartTime().Add(test.startOffset)
		end := series.EndTime().Add(test.endOffset)
		threshold := test.threshold
		millisPerStep := series.MillisPerStep()
		// Calculate the new millisPerStep if the length exceeds the limit on number of data points
		if (series.Len()) > threshold {
			samplingMultiplier := math.Ceil(float64(series.Len()) / float64(threshold))
			millisPerStep = int(samplingMultiplier * float64(series.MillisPerStep()))
		}

		result := LTTB(series, start, end, millisPerStep)
		require.NotNil(t, result)
		require.Equal(t, start, result.StartTime())
		require.False(t, end.After(result.EndTime()))
		require.True(t, end.After(result.StartTimeForStep(result.Len()-1)))

		require.Equal(t, series.Specification, result.Specification)
		require.Equal(t, series.Name(), result.Name())
		require.Equal(t, test.newStep, result.MillisPerStep())
		resultThreshold := test.threshold
		if test.resultThreshold > 0 {
			resultThreshold = test.resultThreshold
		}
		require.Equal(t, result.Len(), resultThreshold)

	}
}

func TestLTTBWithNull(t *testing.T) {
	ctx := context.New()
	defer ctx.Close()
	seriesStart := time.Now()
	stepSize := 1000
	values := NewValues(ctx, stepSize, len(data)/50)
	for i := 0; i < values.Len(); i++ {
		values.SetValueAt(i, data[i].Y)
	}

	values.SetValueAt(0, math.NaN())
	series := NewSeries(ctx, "foo", seriesStart, values)

	series = LTTB(series, series.StartTime(), series.EndTime(), 5000)
	require.True(t, math.IsNaN(series.ValueAt(0)))
	require.False(t, math.IsNaN(series.ValueAt(1)))
}

func TestLTTBAverage(t *testing.T) {
	ctx := context.New()
	defer ctx.Close()
	seriesStart := time.Now()
	values := NewValues(ctx, 1000, 8)
	values.SetValueAt(4, data[4].Y)

	series := NewSeries(ctx, "foo", seriesStart, values)

	series = LTTB(series, series.StartTime(), series.EndTime(), 3000)
	require.False(t, math.IsNaN(series.ValueAt(1)))
	require.InDelta(t, series.ValueAt(1), data[4].Y, 0.001)

	values = NewValues(ctx, 1000, 12)
	values.SetValueAt(7, data[7].Y)
	series = NewSeries(ctx, "foo", seriesStart, values)
	series = LTTB(series, series.StartTime(), series.EndTime(), 3000)
	require.False(t, math.IsNaN(series.ValueAt(2)))
	require.InDelta(t, series.ValueAt(2), data[7].Y, 0.001)
}

